const EVENTS = [
  {
    id: "p1",
  },
  {
    id: "p2",
  },
  {
    id: "p3",
  },
];

export default function EventPage() {
  return (
    <>
      <h1>Event Page</h1>
      <ul>
        {EVENTS.map((event) => {
          return (
            <li key={event.id}>
              <Link to={event.id}>{event.id}</Link>
            </li>
          );
        })}
      </ul>
    </>
  );
}
